import React from 'react';

const TestMain = () => {
    return (<>
        <div className="container-fluid">
            <div className="row">
                <div className="col-lg-10 col-11 mx-auto">
                    <h1 className="font-weight-light text-md-left text-center text-light">COVID-19 Testing Overview</h1>
                </div>
            </div>
        </div>
    </>);
}

export default TestMain;
